(207, '2014-03-10 18:12:50', 'Item Created', 'ZurmoModule', 'Comment', 3, 's:30:"Are we allowed to hire aliens?";', 1),
(208, '2014-03-10 18:12:50', 'Item Created', 'ZurmoModule', 'Comment', 4, 's:236:"Some info about Mars: Mars is the fourth planet from the Sun in the Solar System. Named after the Roman god of war, Mars, it is often described as the "Red Planet" as the iron oxide prevalent on its surface gives it a reddish appearance";', 1),
(209, '2014-03-10 18:12:51', 'Item Created', 'ZurmoModule', 'Comment', 5, 's:32:"Great idea guys. Keep it coming.";', 1),
