(211, '2014-03-10 18:12:55', 'Item Created', 'ZurmoModule', 'Comment', 6, 's:19:"Elephants are cool.";', 1),
(212, '2014-03-10 18:12:55', 'Item Created', 'ZurmoModule', 'Comment', 7, 's:319:"What about giraffes.  Here is some info: he giraffe (Giraffa camelopardalis) is an African even-toed ungulate mammal, the tallest living terrestrial animal and the largest ruminant. Its specific name refers to its camel-like face and the patches of color on its fur, which bear a vague resemblance to a leopard''s spots.";', 1),
